bool is_prime(int x) {
    if (x < 2) return false;
    for (int i = 2; i * i <= x; i++) {
        if (x % i == 0) return false;
    }
    return true;
}

int n;
vector<int> tmp = {1};

void backtrack(int mask = 1, int prev = 1) {
    if (mask == (1 << n) - 1) {
        if (is_prime(prev + 1)) {
            for (int i = 0; i < n; i++) {
                cout << tmp[i] << " \n"[i == n - 1];
            }
        }
        return;
    }
    for (int i = 0; i < n; i++) {
        if (mask & (1 << i)) continue;
        if (is_prime(prev + i + 1)) {
            tmp.push_back(i + 1);
            backtrack(mask | (1 << i), i + 1);
            tmp.pop_back();
        }
    }
}

void solve() {
    int idx = 0;
    while (cin >> n) {
        if (idx)
            cout << endl;
        cout << "Case " << ++idx << ":\n";
        backtrack();
    }
}

