#include <stdio.h>
#include <stdlib.h>

int main()
{

    char str1[100];
    char str2[100];

    gets(str1);
    scanf("%s", str2);

    int flag;
    for (int i = 0; str1[i] != '\0'; i++)
    {
        flag = 1;
        for (int j = 0; str2[j] != '\0'; j++)
        {
            if (str1[i] != str2[j])
            {
                flag = 0;
                break;
            }
            i++;
        }
        if (flag == 1)
        {
            break;
        }
    }

    if (flag == 1)
    {
        printf("Yes\n");
    }
    else
    {
        printf("No\n");
    }

    return 0;
}

