            const string ExitProgramCommand = "7";

            int balanceUsd = 10;
            int balanceRub = 1000;
            int balanceEur = 10;

            int exchangeRateUsdtoRub = 90;
            int exchangeRateUsdtoEur = 1;
            int exchangeRateEurtoRub = 80;
            int exchangeRateEurtoUsd = 1;
            int exchangeRateRubtoUsd = 100;
            int exchangeRateRubtoEur = 90;

            int translationUsd;
            int translationRub;
            int translationEur;

            bool canWork = true;

            while(canWork) 
            {
                Console.Clear();
                Console.WriteLine($"–ë–∞–ª–∞–Ω—Å –≤–∞—à–∏—Ö –∫–æ—à–µ–ª—å–∫–æ–≤:\n" +
                    $"Usd:{balanceUsd}\n" +
                    $"Rub:{balanceRub}\n" +
                    $"Eur:{balanceEur}\n" +
                    $"–ö–∞–∫—É—é –≤–∞–ª—é—Ç—É –≤—ã —Ö–æ—Ç–µ–ª–∏ –±—ã –æ–±–º–µ–Ω—è—Ç—å?\n" +
                    $"{ChangeUsdtoRubCommand})–ü–æ–º–µ–Ω—è—Ç—å usd –Ω–∞ rub.\n" +
                    $"{ChangeUsdtoEurCommand})–ü–æ–º–µ–Ω—è—Ç—å usd –Ω–∞ eur.\n" +
                    $"{ChangeRubtoEurCommand})–ü–æ–º–µ–Ω—è—Ç—å rub –Ω–∞ eur.\n" +
                    $"{ChangeRubtoUsdCommand})–ü–æ–º–µ–Ω—è—Ç—å rub –Ω–∞ usd\n{ChangeEurtoUsdCommand})–ü–æ–º–µ–Ω—è—Ç—å eur –Ω–∞ usd\n" +
                    $"{ChangeEurtoRubCommand})–ü–æ–º–µ–Ω—è—Ç—å eur –Ω–∞ rub\n{ExitProgramCommand})–í—ã–π—Ç–∏ –∏–∑ –±–∞–Ω–∫–∞.");

                switch (Console.ReadLine())
                {
                    case ChangeUsdtoRubCommand:
                        Console.WriteLine("–°–∫–æ–ª—å–∫–æ usd –≤—ã —Ö–æ—Ç–∏—Ç–µ –æ–±–º–µ–Ω—è—Ç—å –Ω–∞ rub?");
                        translationUsd = Convert.ToInt32(Console.ReadLine());

                        if(translationUsd <= balanceUsd) 
                        {
                            balanceUsd -= translationUsd;
                            balanceRub += translationUsd * exchangeRateUsdtoRub;
                        }
                        else
                        {
                            Console.WriteLine("–£ –≤–∞—Å –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ usd –¥–ª—è –æ–±–º–µ–Ω–∞!");
                            Console.ReadKey();
                        }
                        break;

                    case ChangeUsdtoEurCommand:
                        Console.WriteLine("–°–∫–æ–ª—å–∫–æ usd –≤—ã —Ö–æ—Ç–∏—Ç–µ –æ–±–º–µ–Ω—è—Ç—å –Ω–∞ eur?");
                        translationUsd = Convert.ToInt32(Console.ReadLine());

                        if (translationUsd <= balanceUsd)
                        {
                            balanceUsd -= translationUsd;
                            balanceEur += translationUsd * exchangeRateUsdtoEur;
                        }
                        else
                        {
                            Console.WriteLine("–£ –≤–∞—Å –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ usd –¥–ª—è –æ–±–º–µ–Ω–∞!");
                            Console.ReadKey();
                        }
                        break;

                    case ChangeRubtoEurCommand:
                        Console.WriteLine("–°–∫–æ–ª—å–∫–æ rub –≤—ã —Ö–æ—Ç–∏—Ç–µ –æ–±–º–µ–Ω—è—Ç—å –Ω–∞ eur?");
                        translationRub = Convert.ToInt32(Console.ReadLine());

                        if (translationRub <= balanceRub)
                        {
                            balanceRub -= translationRub;
                            balanceEur += translationRub * exchangeRateRubtoEur;
                        }
                        else
                        {
                            Console.WriteLine("–£ –≤–∞—Å –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ rub –¥–ª—è –æ–±–º–µ–Ω–∞!");
                            Console.ReadKey();
                        }
                        break;

                    case ChangeRubtoUsdCommand:
                        Console.WriteLine("–°–∫–æ–ª—å–∫–æ rub –≤—ã —Ö–æ—Ç–∏—Ç–µ –æ–±–º–µ–Ω—è—Ç—å –Ω–∞ usd?");
                        translationRub = Convert.ToInt32(Console.ReadLine());

                        if (translationRub <= balanceRub)
                        {
                            balanceRub -= translationRub;
                            balanceUsd += translationRub * exchangeRateRubtoUsd;
                        }
                        else
                        {
                            Console.WriteLine("–£ –≤–∞—Å –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ rub –¥–ª—è –æ–±–º–µ–Ω–∞!");
                            Console.ReadKey();
                        }
                        break;

                    case ChangeEurtoUsdCommand:
                        Console.WriteLine("–°–∫–æ–ª—å–∫–æ eur –≤—ã —Ö–æ—Ç–∏—Ç–µ –æ–±–º–µ–Ω—è—Ç—å –Ω–∞ usd?");
                        translationEur = Convert.ToInt32(Console.ReadLine());

                        if (translationEur <= balanceEur)
                        {
                            balanceEur -= translationEur;
                            balanceUsd += translationEur * exchangeRateEurtoUsd;
                        }
                        else
                        {
                            Console.WriteLine("–£ –≤–∞—Å –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ eur –¥–ª—è –æ–±–º–µ–Ω–∞!");
                            Console.ReadKey();
                        }
                        break;

                    case ChangeEurtoRubCommand:
                        Console.WriteLine("–°–∫–æ–ª—å–∫–æ eur –≤—ã —Ö–æ—Ç–∏—Ç–µ –æ–±–º–µ–Ω—è—Ç—å –Ω–∞ rub?");
                        translationEur = Convert.ToInt32(Console.ReadLine());

                        if (translationEur <= balanceEur)
                        {
                            balanceEur -= translationEur;
                            balanceRub += translationEur * exchangeRateEurtoRub;
                        }
                        else
                        {
                            Console.WriteLine("–£ –≤–∞—Å –Ω–µ–¥–æ—Å—Ç–∞—Ç–æ—á–Ω–æ eur –¥–ª—è –æ–±–º–µ–Ω–∞!");
                            Console.ReadKey();
                        }
                        break;

                    case ExitProgramCommand:
                        canWork = false;
                        break;
                }
            }      
        }
    }
}

